import React, { Fragment } from "react";
import {Link} from 'react-router-dom';
import './css/userpage.css'

function Userpage(){

    useEffect(() => {
        if (localStorage.username != null) {
          document.getElementById("userid").innerHTML = localStorage.username;
        }
      }, []);

    return (
        <Fragment>
            <div className="body_userpage">

<div className="navbar">
    <div className="container">
            <Link className="logo" to = "/"><span>RMH</span>Shop</Link>
        
        <img id="mobile-cta" className="mobile-menu" src="./images/menu.svg" alt="Open navigation"/>

        <nav>
            <img id="mobile-exit" className="mobile-menu-exit" src="./images/exit.svg" alt="Close navigation"/>
            <ul className="primary-nav">
                    <li > <Link to = "/">Home</Link></li>
                    <li > <Link to = "/Products">Products</Link></li>
            </ul>

            <ul className="secondary-nav">
                 <li > <Link to = "/SignIn">Signin</Link></li>
                 <li > <Link to = "/Userpage">User not logged</Link></li>
            </ul>

        </nav>
    </div>
</div>
<div className="buttoncont">
    <button className="logoutbtn" id="logout1">Log out</button>
</div>
  


</div>
        </Fragment>
    )
}

export default Userpage;
